INSERT INTO `evaluation_sentiments` (`sentiment_id`, `student_id`, `evaluation_id`, `teacher_id`, `subject_id`, `sentiment`, `created_at`, `sentiment_type`) VALUES
(10, 29, 85, 3, 2, 'Effective magturo, madaling matuto sa klase.', '2024-10-14 14:42:53', 2),
(11, 29, 85, 6, 4, 'Madalas hindi available kapag kailangan ng assistance.', '2024-10-14 14:49:52', 0),
(12, 29, 85, 10, 7, 'Masungit minsan kapag nagtatanong ang students.', '2024-10-14 16:44:46', 0),
(24, 5, 85, 3, 2, 'Si maam ang galing mag-connect ng lessons sa real life, kaya mas madali siyang maintindihan. Parang laging may relevant na example, kaya hindi ka mabobore.', '2024-10-24 04:04:03', 2),
(25, 25, 85, 3, 2, 'Masyadong mabilis yung pacing ni maam, parang di pa tapos yung isang topic, move on agad sa next. Hindi ko nasasakyan yung discussion, kaya ang daming kailangan i-review.', '2024-10-24 04:05:41', 1),
(26, 16, 85, 3, 2, 'Okay lang si maam magturo, wala namang special pero natututo ka naman. Hindi siya masyadong interactive, pero at least clear yung instructions.', '2024-10-24 04:06:46', 2),
(27, 18, 85, 3, 2, 'Ang fun ng discussions ni maam, laging interactive kaya di ka tatamarin pumasok. Pati yung mga mahiyain sa klase, nagiging active kasi ang galing niya mag-encourage.', '2024-10-24 04:08:03', 2),
(28, 26, 85, 3, 2, 'Madalas late dumating si maam, tapos pagdating parang nagmamadali magturo. Hindi tuloy makuha yung mga importanteng parts kasi rush yung lahat.', '2024-10-24 04:08:57', 0),
(31, 24, 85, 13, 3, 'Ang saya ng vibes ni maam, parang barkada pero siguradong matututo ka. Chill pero effective, kaya hindi ka tatamarin pumasok.', '2024-10-24 05:25:00', 2),
(35, 30, 93, 11, 18, 'Ang galing magturo ng english ni maam talagang machachallenge ka para magbigay ng effort para matuto. Ang dami kong natutunan buti nalang si maam ang naging teacher ko.', '2024-10-25 08:13:01', 2),
(38, 30, 93, 13, 22, 'Very nice!!!', '2024-11-11 14:50:47', 2),
(57, 1, 85, 3, 2, 'Okay sa alright!', '2024-11-13 12:19:25', 2),
(58, 1, 85, 6, 4, 'pede na', '2024-11-13 12:19:48', 0),
(59, 1, 85, 10, 7, 'Magaling kaso kulang sa bait', '2024-11-13 12:20:13', 0),
(62, 38, 85, 3, 2, 'Very good!', '2024-11-16 04:37:37', 2),
(64, 1, 85, 7, 6, 'Very good teacher. Slay all day everyday!', '2024-11-20 14:12:43', 2),
(65, 1, 85, 13, 3, 'Masaya ang klase ni maam di ka talaga mabobored. Super resourceful ang daming matutunan.', '2024-11-25 03:24:48', 2),
(66, 1, 85, 13, 9, 'Sa totoo lang, nahirapan ako sa klase niya dahil parang hindi malinaw ang mga paliwanag niya, at madalas pa siyang magmadali sa mga discussions. Kahit magtanong kami, parang walang effort na sagutin nang maayos, kaya nakakalito lalo. Mahirap din ang mga requirements niya, pero hindi rin siya nagbibigay ng sapat na gabay kung paano ito dapat gawin. Pakiramdam ko, wala siyang interest na tulungan kaming mag-improve, at parang basta lang matapos ang klase. Sana naman mas maging approachable siya at mas maglaan ng oras para sa mga estudyante.', '2024-11-25 06:47:37', 0),
(67, 1, 85, 32, 12, 'Laging absent at wala hindi nagtuturo.', '2024-11-27 01:24:48', 0);
